jQuery(document).ready(function() {
  /* Take the control of hidden elements with jQuery */
  jQuery('.hidden, .hidden-if-js').removeClass('hidden hidden-if-js').hide();

  /* For our IE users */
  jQuery('input, textarea').placeholder();
});
// BEGIN FLASH MESSAGE CODE
// Shows the flash message bar.  Takes an object literal with the following parameters:
//   args.messageText - The text you want to show.
//   args.alertLevel - Changes the color of the flash message bar.  Has three levels: "info",
//                     "warn", and "error".
//
// Example: showFlashMessage( { messageText: "I accidentally the server.", alertLevel: "error" });
function showFlashMessage( args ) {
  // Populate the message text
  jQuery("#flash_message_content").html(args.messageText);

  var flashDiv = jQuery('#flash_message');
  // TODO: Change the colors of the bar, according to the type of message
    // info
    // warn
    // error

  // Show the bar.
  flashDiv.slideDown('fast');

};

// Hides the flash message bar
function hideFlashMessage() {
  jQuery('#flash_message').slideUp('fast');
};

// Clears the topmost flash message off the queue, and displays the next.
// Hides the flash if the queue is empty.
function clearFlashMessage() {
  // Nuke the topmost message.
  flashQueue.shift();

  // Display the next message if there is one.  Hide the flash if not.
  if (flashQueue.length > 0) {
    showFlashMessage(flashQueue[0]);
  } else {
    hideFlashMessage();
  }
};

// Adds a flash message to the queue.  Creates the queue if necessary.
function enqueueFlashMessage(message) {
  // Add the message to the queue.
  flashQueue.push(message);
};

// Show the flash message for all the things in the flash on pageload.
jQuery(document).ready(function() {
  flashQueue = new Array();  //Create the flashQueue here

  // Populate the flashQueue
  jQuery.each(flash, function(){
    enqueueFlashMessage( { messageText: this[1], alertLevel: this[0] });
  });

  // Is there something in the flashQueue? Show the first one.
  if(flashQueue.length > 0) {
    showFlashMessage(flashQueue[0]);
  }
});


// END FLASH MESSAGE CODE

jQuery(document).ready(function() {
  jQuery('.sharing .tools .embed').qtip({
    position: {
      my: 'top center',
      at: 'bottom center'
    },
    style: {
      classes: 'ui-tooltip-shadow ui-tooltip-tipsy'
    }
  });
});

// Toggle for the "browse" button
jQuery(function() {
  jQuery('.browse').toggle( function(){
    jQuery('.browse-menu').slideDown();
    jQuery('.main-header').css({ border: 0 });
    jQuery(this).addClass('browse-open');
    },
    function(){
      jQuery('.browse-menu').slideUp( 'normal', function(){
	jQuery('.main-header').css({ borderBottom: '5px solid #777' });
      });
      jQuery(this).removeClass('browse-open');
    }
  );
});

/* Modal login */
jQuery(document).ready(function() {
  jQuery('.login-search-menu .login').qtip({
    content: {
      text: jQuery('.login-elements .container')
    },
    show: {
      event: 'click'
    },
    hide: {
      event: 'unfocus click'
    },
    position: {
      my: 'top center',
      at: 'bottom center'
    },
    style: {
      tip: false,
      width: '350px',
      classes: 'ui-tooltip-shadow ui-tooltip-tipsy ui-tooltip modal-login'
    }
  });

  if (jQuery('#forgot_password').length > 0) {
    jQuery('.login-search-menu .login').click();
  }
});

